}

export default function Nav() {
  return (
    <>
      <div
        className="my-navbar w3-sidebar w3-bar-block w3-black"
        style={{
          width: "15vh"
        }}
      >
        <div className="hamburger">
          <h4 onClick={() => console.log('w')}>.devtoti<span>_</span></h4>
          <FontAwesomeIcon onClick={() => console.log('w')} icon="bars" size="2x" fixedWidth />
        </div>
        <nav>
          <ul>{NavItems(navSection)}</ul>
        </nav>
        <main>

          <Dialog
            fullScreen
            open='false'
            onClose={handleClose}
          >
            <p>success</p>
            </Dialog>
        </main>
      </div>
      <Outlet />
    </>
  );
}
